"use strict";(self.webpackChunkmisinfocon_india_docs=self.webpackChunkmisinfocon_india_docs||[]).push([[53],{1109:i=>{i.exports=JSON.parse('{"pluginId":"default","version":"current","label":"Next","banner":null,"badge":false,"noIndex":false,"className":"docs-version-current","isLast":true,"docsSidebars":{"tutorialSidebar":[{"type":"link","label":"Introduction","href":"/misinfocon-india-docs/docs/intro","docId":"intro"},{"type":"category","label":"Proposals","collapsible":true,"collapsed":true,"items":[{"type":"link","label":"Addressing Missing and MisInformation","href":"/misinfocon-india-docs/docs/proposals/addressing-missing-and-mis-information","docId":"proposals/addressing-missing-and-mis-information"},{"type":"link","label":"Media Minds - Fostering Fact-Checking Skills Amongst the Youth","href":"/misinfocon-india-docs/docs/proposals/media-minds-fostering-fact-checking-skills-amongst-the-youth","docId":"proposals/media-minds-fostering-fact-checking-skills-amongst-the-youth"},{"type":"link","label":"Reference Guide to Understanding LGBTQIAP Community","href":"/misinfocon-india-docs/docs/proposals/reference-guide-to-understanding-lgtbqiap-community","docId":"proposals/reference-guide-to-understanding-lgbtqiap-community"}],"href":"/misinfocon-india-docs/docs/category/proposals"}]},"docs":{"intro":{"id":"intro","title":"Introduction","description":"Anyone with an idea pertaining to any of the working groups can submit a proposal. Your proposal is an idea for a project that you would like to work on. Creating a proposal is the first step to announce your idea to the community and get feedback on it. It is also a great way to be noticed by possible collaborators. While everyone is encouraged to create proposals for anything you\'d like to be seen built, its most fruitful to create proposals for projects that you\'d like to be actively lead and build.","sidebar":"tutorialSidebar"},"proposals/addressing-missing-and-mis-information":{"id":"proposals/addressing-missing-and-mis-information","title":"Addressing Missing and MisInformation","description":"Through this project, we aim to address the missing information and misinformation problems about Intersex and Asexual communities across Karnataka. This project is not limited to building an information system for communities, but ensuring the same is available and accessible in regional languages. The corpus generated, would be made public under a creative commons license. We aim to leverage free and open source, audio/video narration, annotation, and story building platforms.","sidebar":"tutorialSidebar"},"proposals/media-minds-fostering-fact-checking-skills-amongst-the-youth":{"id":"proposals/media-minds-fostering-fact-checking-skills-amongst-the-youth","title":"Media Minds - Fostering Fact-Checking Skills Amongst the Youth","description":"This initiative is dedicated to investigating the influence of media literacy and hands-on training in fact-checking among young individuals.","sidebar":"tutorialSidebar"},"proposals/reference-guide-to-understanding-lgbtqiap-community":{"id":"proposals/reference-guide-to-understanding-lgbtqiap-community","title":"Reference Guide to Understanding LGBTQIAP Community","description":"This project is aimed at creating an ultimate guide (digital and print) that educates and spreads awareness about the community, especially among the various key stakeholders of the society (media, educational institutions, judiciary, ministries).","sidebar":"tutorialSidebar"}}}')}}]);